import React from "react";

import "./welcome.css";

const Welcome = () => {
    const [render, setRender] = React.useState(true);

    const end = () => {
        setRender(false)
    };

    return <div className="temp" onAnimationEnd={() => end()}>Hello</div>;
};

export default Welcome;
